-- ----------------------------
-- Table structure for promotion_combination_record
-- ----------------------------
DROP TABLE IF EXISTS `promotion_combination_record`;
CREATE TABLE `promotion_combination_record`  (
  `id` bigint(0) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `activity_id` bigint(0) DEFAULT NULL COMMENT '拼团活动编号',
  `spu_id` bigint(0) DEFAULT NULL COMMENT '商品 SPU 编号',
  `sku_id` bigint(0) DEFAULT NULL COMMENT '商品 SKU 编号',
  `user_id` bigint(0) DEFAULT NULL COMMENT '用户编号',
  `head_id` bigint(0) DEFAULT NULL COMMENT '团长编号',
  `order_id` bigint(0) DEFAULT NULL COMMENT '订单编号',
  `status` tinyint(0) NOT NULL DEFAULT 0 COMMENT '参与状态：1进行中 2已完成 3未完成',
  `combination_price` int(0) NOT NULL COMMENT '拼团商品单价，单位分',
  `nickname` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT '' COMMENT '用户昵称',
  `avatar` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT '' COMMENT '用户头像',
  `expire_time` datetime(0) NOT NULL COMMENT '过期时间',
  `user_size` int(0) NOT NULL COMMENT '可参团人数',
  `user_count` int(0) NOT NULL COMMENT '已参团人数',
  `virtual_group` bit(1) DEFAULT NULL COMMENT '是否虚拟拼团',
  `end_time` datetime(0) NOT NULL COMMENT '结束时间（成团时间/失败时间）',
  `pic_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '商品图片',
  `spu_name` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '商品名称',
  `creator` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT '' COMMENT '创建者',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updater` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT '' COMMENT '更新者',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  `deleted` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `tenant_id` bigint(0) NOT NULL DEFAULT 0 COMMENT '租户编号',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '拼团记录' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for promotion_coupon
-- ----------------------------
DROP TABLE IF EXISTS `promotion_coupon`;
CREATE TABLE `promotion_coupon`  (
  `id` bigint(0) NOT NULL AUTO_INCREMENT COMMENT '优惠劵编号',
  `template_id` bigint(0) NOT NULL COMMENT '优惠劵模板编号',
  `name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '优惠劵名',
  `status` tinyint(0) NOT NULL COMMENT '优惠码状态\n     *\n     * 1-未使用\n     * 2-已使用\n     * 3-已失效',
  `user_id` bigint(0) NOT NULL COMMENT '用户编号',
  `take_type` tinyint(0) NOT NULL COMMENT '领取类型\n     *\n     * 1 - 用户主动领取\n     * 2 - 后台自动发放',
  `use_price` int(0) NOT NULL COMMENT '是否设置满多少金额可用，单位：分',
  `valid_start_time` datetime(0) NOT NULL COMMENT '生效开始时间',
  `valid_end_time` datetime(0) NOT NULL COMMENT '生效结束时间',
  `product_scope` tinyint(0) NOT NULL COMMENT '商品范围',
  `product_spu_ids` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '商品 SPU 编号的数组',
  `discount_type` tinyint(0) NOT NULL COMMENT '折扣类型',
  `discount_percent` tinyint(0) DEFAULT NULL COMMENT '折扣百分比',
  `discount_price` int(0) DEFAULT NULL COMMENT '优惠金额，单位：分',
  `discount_limit_price` int(0) DEFAULT NULL COMMENT '折扣上限',
  `use_order_id` bigint(0) DEFAULT NULL COMMENT '使用订单号',
  `use_time` datetime(0) DEFAULT NULL COMMENT '使用时间',
  `creator` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '创建者',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updater` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '更新者',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  `deleted` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `tenant_id` bigint(0) NOT NULL DEFAULT 0 COMMENT '租户编号',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 6 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '优惠劵' ROW_FORMAT = Dynamic;

