  `take_limit_count` tinyint(0) NOT NULL COMMENT '每人限领个数, -1 - 则表示不限制',
  `take_type` tinyint(0) NOT NULL COMMENT '领取方式',
  `use_price` int(0) NOT NULL COMMENT '是否设置满多少金额可用，单位：分',
  `product_scope` tinyint(0) NOT NULL COMMENT '商品范围',
  `product_scope_values` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL,
  `product_spu_ids` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '商品 SPU 编号的数组',
  `validity_type` tinyint(0) NOT NULL COMMENT '生效日期类型',
  `valid_start_time` datetime(0) DEFAULT NULL COMMENT '固定日期-生效开始时间',
  `valid_end_time` datetime(0) DEFAULT NULL COMMENT '固定日期-生效结束时间',
  `fixed_start_term` int(0) DEFAULT NULL COMMENT '领取日期-开始天数',
  `fixed_end_term` int(0) DEFAULT NULL COMMENT '领取日期-结束天数',
  `discount_type` int(0) NOT NULL COMMENT '优惠类型\n     *\n     * 1-代金卷\n     * 2-折扣卷',
  `discount_percent` tinyint(0) DEFAULT NULL COMMENT '折扣百分比',
  `discount_price` int(0) DEFAULT NULL COMMENT '优惠金额，单位：分',
  `discount_limit_price` int(0) DEFAULT NULL COMMENT '折扣上限，仅在 {@link #preferentialType} 等于 2 时生效。\n     *\n     * 例如，折扣上限为 20 元，当使用 8 折优惠券，订单金额为 1000 元时，最高只可折扣 20 元，而非 80  元。',
  `take_count` int(0) NOT NULL DEFAULT 0 COMMENT '领取优惠券的数量',
  `use_count` int(0) NOT NULL DEFAULT 0 COMMENT '使用优惠券的次数',
  `creator` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '创建者',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updater` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '更新者',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  `deleted` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `tenant_id` bigint(0) NOT NULL DEFAULT 0 COMMENT '租户编号',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 17 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '优惠劵模板' ROW_FORMAT = Dynamic;

